import React from "react";
import { DialogUtils } from "react-open-dialog";

function FrontEnd() {
  return (
    <div>
      <table class="table table-bordered">
        <thead>
          <tr>
            <th>week</th>
            <th>courseName</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1 - 2</td>
            <td>React fundamenals and Hooks</td>
            <td>
              {/* <button>Addresource</button> */}
              <div>
                <button
                  onClick={() => {
                    DialogUtils.openCustomDialog({
                      title: "Custom Dialog",
                      customRender: ({ closeDialog }) => {
                        return (
                          <div>
                            <p>My very first custom dialog </p>
                            <button
                              onClick={() => {
                                closeDialog();
                              }}
                            >
                              Close
                            </button>
                          </div>
                        );
                      },
                    });
                  }}
                >
                  Open Custom Dialog
                </button>
              </div>
              <button>viewresource</button>
            </td>
          </tr>
          <tr>
            <td>2 - 4</td>
            <td>React Redux</td>
            <td>
              <button>Addresource</button>
              <button>viewresource</button>
            </td>
          </tr>
          <tr>
            <td>5 - 6</td>
            <td>Unit Testing using RTL</td>
            <td>
              <button onClick>Addresource</button>
              <button>viewresource</button>
            </td>
          </tr>
          <tr>
            <td>7 - 8</td>
            <td>Project</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default FrontEnd;
